properties.description:
All’inizio di Corso Buenos Aires, a pochi passi dalla metropolitana M1 Porta Venezia, al sesto e ultimo piano di un elegante palazzo d’epoca con ascensore fino al quinto piano e portineria, ampio e luminoso monolocale su due ambienti di complessivi 50 mq circa, completamente arredato e corredato, particolarmente silenzioso grazie all’affaccio interno:
•	ingresso su una spaziosa zona giorno/notte, con angolo eventualmente dedicabile all’home working, luminosa grazie a un lucernario e a una porta finestra che si apre su un caratteristico terrazzino a tasca vivibile con fioriera e vista panoramica sulla città e sulla Chiesa di Santa Francesca Romana;
•	disimpegno ornato da una finestra decorativa con mosaico di vetro;
•	ampia cucina abitabile completamente attrezzata e corredata con zona pran
